import React from 'react';

type TodolistType = {
   task: Array<TaskType>
}

type TaskType = {
    id:string;
    title:string;
    isDone:boolean;
}

export  const Todolist = (props:TodolistType) => {
    return (
        <div>
         <ul>

                 {props.task.map((el)=>{
                     return (
                         <li key={el.id}>{el.title}</li>
                     )
                 })
                 }

         </ul>
        </div>
    );
};
